    <div className="sideMenu">
      {/* 사이드 메뉴 아이템들을 추가합니다 */}
      <div className="sideMenuItem">부승관</div>
      <div className="sideMenuItem">메뉴 2</div>
      <div className="sideMenuItem">메뉴 3</div>
      {/* 필요한 만큼 메뉴를 추가할 수 있습니다 */}
    </div>
  );
};

export default SideMenu;
